import React, { useState } from "react";
import "./NewExpense.css";
import ExpenseForm from "./ExpenseForm";

function NewExpense(props) {
  const [expenseContent, setExpenseContent] = useState(addExpenseContent);
  let addExpenseContent = addExpenseBtn;
  const addExpenseBtn = (
    <button onClick={addExpenseFormHandler}>Add Expense</button>
  );

  const saveExpenseDataHandler = (enteredExpenseData) => {
    const expenseData = {
      ...enteredExpenseData,
      id: Math.random().toString(),
    };
    props.onAddExpense(expenseData);
  };

  const expenseFormComp = (
    <ExpenseForm onSaveExpenseData={saveExpenseDataHandler} />
  );

  const addExpenseFormHandler = () => {
    return expenseFormComp;
  };

  return <div className="new-expense">{expenseContent}</div>;
}

export default NewExpense;
